import react from 'react';

const About = () => {
    return (
        <div className="About" id={"about"}>
            <h2>About me</h2>
            <p>Welcome traveller. My name is Winston and I love programming and movies. I am a creative, collaborative film-maker who does not shy away from challenging tasks. I am eager to grow my knowledge and enhance skills. Follow me on my journey as I try to unite my two passions, programming and film-making.</p>
            <h3>Tech Stack</h3>
            <ul>
                <li>HTML, CSS, JS</li>
                <li>JAVA</li>
                <li>Python</li>
                <li>DaVinci Resolve</li>
                <li>Adobe Light Room</li>
            </ul>
        </div>
    )
}

export default About;
